import React from 'react';
import {Form} from 'semantic-ui-react';

const SignUp = () => {
    return (
        <Form id='sign-up-form'>

            <Form.Input id='sign-up-form-email'> </Form.Input>

            <Form.Input id='sign-up-form-first-name'> </Form.Input>

            <Form.Input id='sign-up-form-last-name'> </Form.Input>

            {/* to modify to dropdown menu */}
            {/* https://react.semantic-ui.com/modules/dropdown/#types-search-selection */}
            <Form.Input id='sign-up-form-birth-month' width={6}> </Form.Input>
            <Form.Input id='sign-up-form-birth-day' width={2}> </Form.Input>
            <Form.Input id='sign-up-form-birth-year' width={6}> </Form.Input>


        </Form>

    );
};

export default SignUp;
